这段代码实现了 Hub 类中的路由决策方法，用于确定数据包（Flit）的下一跳方向。 int Hub::route(Flit& f)
{ // 本地连接到 Hub 的节点 ID for (vector<int>::size_type i=0; i< GlobalParams::hub_configuration[local_id].attachedNodes.size();i++) { // ...to a destination which is connected to the Hub if (GlobalParams::hub_configuration[local_id].attachedNodes[i]==f.dst_id) { return tile2Port(f.dst_id); } //到连接到目的节点并与hub相连的一个节点 if (GlobalParams::hub_configuration[local_id].attachedNodes[i]==f.hub_relay_node) { assert(GlobalParams::winoc_dst_hops>0); return tile2Port(f.hub_relay_node); } } return DIRECTION_WIRELESS;
//两者条件都不满足，表示需要无线路由
}

