这是 Hub 类中的接收功率管理方法，用于控制和统计接收相关的功耗。 void Hub::rxPowerManager()
{ // Check wheter accounting or not buffer to tile leakage // For each port, two poweroff condition should be checked: // - the buffer to tile is empty // - it has not been reserved // currently only supported without VC assert(GlobalParams::n_virtual_channels==1); for (int port=0;port<num_ports;port++) { if (!buffer_to_tile[port][DEFAULT_VC].IsEmpty() || antenna2tile_reservation_table.isNotReserved(port))//BUFFER非空或者端口未被预留 power.leakageBufferToTile(); else buffer_to_tile_poweroff_cycles[port]++; //端口休眠cycle++ } for (unsigned int i=0;i<rxChannels.size();i++) { int ch_id = rxChannels[i]; if (!target[ch_id]->buffer_rx.IsEmpty()) //检查天线接收缓冲区是否为空 { power.leakageAntennaBuffer(); } else buffer_rx_sleep_cycles[ch_id]++; } // Check wheter accounting antenna RX buffer // check if there is at least one not empty antenna RX buffer // To be only applied if the current hub is in RADIO_EVENT_SLEEP_ON mode if (power.isSleeping()) total_sleep_cycles++; else // not sleeping { power.wirelessSnooping(); power.leakageTransceiverRx(); power.biasingRx(); }
}

