void Hub::updateRxPower()
{ // 1. 检查是否使用功率管理器 if (GlobalParams::use_powermanager) // 2. 如果使用，调用 rxPowerManager 进行详细的功率管理 rxPowerManager(); else { // 3. 如果不使用，执行基本的功率计算 power.wirelessSnooping(); // 无线监听功耗 power.leakageTransceiverRx(); // 接收器泄漏功耗 power.biasingRx(); // 接收器偏置功耗 // 4. 遍历所有接收通道和虚拟通道，计算天线缓冲区泄漏功耗 for (unsigned int i=0; i<rxChannels.size(); i++) for (int vc=0; vc<GlobalParams::n_virtual_channels; vc++) power.leakageAntennaBuffer(); // 5. 遍历所有端口和虚拟通道，计算 Tile 缓冲区泄漏功耗 for (int i = 0; i < num_ports; i++) for (int vc=0; vc<GlobalParams::n_virtual_channels; vc++) power.leakageBufferToTile(); }
}

