void Hub::txPowerManager()
{ // 1. 遍历所有发送通道 for (unsigned int i = 0; i < txChannels.size(); i++) { // 2. 检查通道是否为空闲或未被预留 if (!init[i]->buffer_tx.IsEmpty() || tile2antenna_reservation_table.isNotReserved(i)) { // 3. 如果通道活动，则计算天线缓冲区泄漏功耗 power.leakageAntennaBuffer(); // 4. 检查 Hub 是否处于休眠状态 if (power.isSleeping()) { // 5. 如果处于休眠状态，则增加模拟发送关闭周期计数 analogtxoff_cycles[i]++; } else { // 6. 如果未处于休眠状态，则计算发送器泄漏功耗和偏置功耗 power.leakageTransceiverTx(); power.biasingTx(); } } else { // 7. 如果通道空闲且未被预留，则增加各种关闭周期计数 abtxoff_cycles[i]++; // 天线缓冲区关闭周期 analogtxoff_cycles[i]++; // 模拟发送关闭周期 total_ttxoff_cycles++; // 总发送关闭周期 } }
}

