这是 Hub 类中处理令牌包传输的方法。让我们详细分析其实现和功能。 核心功能 1. 状态检查 int current_holder = current_token_holder[channel]->read();
int current_channel_flag = flag[channel]->read(); 获取当前令牌持有者 获取当前通道标志状态 2. 处理逻辑 当本地节点持有令牌且通道未释放时，进行以下处理： 发送缓冲区非空时： if (!init[channel]->buffer_tx.IsEmpty()) { Flit flit = init[channel]->buffer_tx.Front(); init[channel]->start_request_event.notify();
} 获取待发送的数据包 触发传输请求事件 发送缓冲区为空时： 如果没有正在进行的传输，释放令牌 如果有传输正在进行，保持令牌 void Hub::txRadioProcessTokenPacket(int channel)
{ int current_holder = current_token_holder[channel]->read();//获取当前令牌持有者 int current_channel_flag =flag[channel]->read();//获取当前通道标志状态 if ( current_holder == local_id && current_channel_flag !=RELEASE_CHANNEL) //本地节点持有令牌且通道未释放 { if (!init[channel]->buffer_tx.IsEmpty())//发送缓冲区非空时 { Flit flit = init[channel]->buffer_tx.Front();//获取待发送的数据包 // TODO: check whether it would make sense to use transmission_in_progress to // avoid multiple notify() LOG << "*** [Ch"<<channel<<"] Requesting transmission event of flit " << flit << endl; init[channel]->start_request_event.notify(); //触发传输请求事件 } else { if (!transmission_in_progress.at(channel)) //没有传输正在进行 { LOG << "*** [Ch"<<channel<<"] Buffer_tx empty and no trasmission in progress, releasing token" << endl; flag[channel]->write(RELEASE_CHANNEL); //标记通道为释放状态 } else LOG << "*** [Ch"<<channel<<"] Buffer_tx empty, but trasmission in progress, holding token" << endl; } }
}

