void Hub::txRadioProcessTokenHold(int channel)
{ // 1. 如果通道被释放，则重新持有 if (flag[channel]->read() == RELEASE_CHANNEL) flag[channel]->write(HOLD_CHANNEL); // 2. 检查当前 Hub 是否为令牌持有者 if (current_token_holder[channel]->read() == local_id) { // 3. 检查发送缓冲区是否为空 if (!init[channel]->buffer_tx.IsEmpty()) { // 4. 检查令牌过期时间是否足够发送数据包 if (current_token_expiration[channel]->read() < flit_transmission_cycles[channel]) { // 5. 如果令牌时间不足，则不发送数据包 //LOG << "TOKEN_HOLD policy: Not enough token expiration time for sending channel " << channel << endl; } else { // 6. 如果令牌时间足够，则持有通道并触发传输事件 flag[channel]->write(HOLD_CHANNEL); LOG << "*** [Ch" << channel << "] Starting transmission event" << endl; init[channel]->start_request_event.notify(); } } else { // 7. 如果发送缓冲区为空，则继续持有令牌 //LOG << "TOKEN_HOLD policy: nothing to transmit, holding token for channel " << channel << endl; } }
}

