void Hub::txRadioProcessTokenMaxHold(int channel)
{ // 1. 如果通道被释放，则重新持有 if (flag[channel]->read() == RELEASE_CHANNEL) flag[channel]->write(HOLD_CHANNEL); // 2. 检查当前 Hub 是否为令牌持有者 if (current_token_holder[channel]->read() == local_id) { // 3. 检查发送缓冲区是否为空 if (!init[channel]->buffer_tx.IsEmpty()) { // 4. 检查令牌过期时间是否足够发送数据包 if (current_token_expiration[channel]->read() < flit_transmission_cycles[channel]) { // 5. 如果令牌时间不足，则释放令牌 //LOG << "TOKEN_MAX_HOLD: Not enough token expiration time, releasing token for channel " << channel << endl; flag[channel]->write(RELEASE_CHANNEL); } else { // 6. 如果令牌时间足够，则持有通道并触发传输事件 flag[channel]->write(HOLD_CHANNEL); LOG << "Starting transmission on channel " << channel << endl; init[channel]->start_request_event.notify(); } } else { // 7. 如果发送缓冲区为空，则释放令牌 //LOG << "TOKEN_MAX_HOLD: Buffer_tx empty, releasing token for channel " << channel << endl; flag[channel]->write(RELEASE_CHANNEL); } }
} void Hub::antennaToTileProcess()
{ // 1. 复位处理: 如果复位信号有效，则初始化输出端口 if (reset.read()) { for (int i = 0; i < num_ports; i++) { req_tx[i]->write(0); // 关闭请求信号 current_level_tx[i] = 0;	// 重置当前发送电平 } return; } // 重要: 请勿移动此行! // rxPowerManager 必须在从缓冲区移除 Flit 之前执行其检查 updateRxPower(); /*********************************************************************************** 数据从天线流向 Tile 包含 3 个不同的步骤: 1) 从无线信道接收的数据存储到特定的 buffer_rx (如果可能) 2) 在 buffer_rx 中找到的数据移动到 buffer_to_tile 3) 在 buffer_to_tile 中找到的数据移动到 signal_tx 从实现的角度来看, 它们以 3-2-1 的顺序执行, 以模拟一种流水线序列 ***********************************************************************************/ ////////////////////////////////////////////////////////////////////////////////////// // 将 Flit 从 buffer_to_tile 移动到相应的 signal_tx // 无需路由: 每个端口都与一个预定义的 Tile 相关联 for (int i = 0; i < num_ports; i++) { // TODO: 检查阻塞通道 (例如阻塞单个信号?) for (int k = 0; k < GlobalParams::n_virtual_channels; k++) { int vc = (start_from_vc[i] + k) % (GlobalParams::n_virtual_channels); if (!buffer_to_tile[i][vc].IsEmpty()) { Flit flit = buffer_to_tile[i][vc].Front(); LOG << "Flit " << flit << " found on buffer_to_tile[" << i << "][" << vc << "] " << endl; if (current_level_tx[i] == ack_tx[i].read() && buffer_full_status_tx[i].read().mask[vc] == false) { LOG << "Flit " << flit << " moved from buffer_to_tile[" << i << "][" << vc << "] to signal flit_tx[" << i << "] " << endl; flit_tx[i].write(flit); // 将 Flit 写入输出端口 current_level_tx[i] = 1 - current_level_tx[i];	// 翻转当前电平 req_tx[i].write(current_level_tx[i]); // 写入请求信号 buffer_to_tile[i][vc].Pop(); // 从 buffer_to_tile 移除 Flit power.bufferToTilePop(); // 更新 bufferToTile 弹出操作的功耗统计 power.r2hLink(); // 更新 Router 到 Hub 链路的功耗统计 break; // 端口 Flit 已发送, 跳过剩余 VC } else { LOG << "Flit " << flit << " cannot move from buffer_to_tile[" << i << "][" << vc << "] to signal flit_tx[" << i << "] " << endl; } } // if buffer not empty } start_from_vc[i] = (start_from_vc[i] + 1) % GlobalParams::n_virtual_channels; } ///////////////////////////////////////////////////////////////////////////////// // 将 Flit 从天线 buffer_rx 移动到相应的 buffer_to_tile // // 两个不同的阶段: // 1) 存储有关传入 Flit 的路由决策 (例如, 到哪个输出端口) // 2) 移动 Flit 并从天线 buffer_rx 中移除 for (unsigned int i = 0; i < rxChannels.size(); i++) { int channel = rxChannels[i]; if (!(target[channel]->buffer_rx.IsEmpty())) { Flit received_flit = target[channel]->buffer_rx.Front(); power.antennaBufferFront(); // 检查天线 buffer_rx 并进行适当的预留 if (received_flit.flit_type == FLIT_TYPE_HEAD) { int dst_port; if (received_flit.hub_relay_node != NOT_VALID) dst_port = tile2Port(received_flit.hub_relay_node); else dst_port = tile2Port(received_flit.dst_id); TReservation r; r.input = channel; r.vc = received_flit.vc_id; LOG << " Checking reservation availability of output port " << dst_port << " by channel " << channel << " for flit " << received_flit << endl; int rt_status = antenna2tile_reservation_table.checkReservation(r, dst_port); if (rt_status == RT_AVAILABLE) { LOG << "Reserving output port " << dst_port << " by channel " << channel << " for flit " << received_flit << endl; antenna2tile_reservation_table.reserve(r, dst_port); // 使用无线网络进行的通信次数, 也包括部分有线路径 wireless_communications_counter++; } else if (rt_status == RT_ALREADY_SAME) { LOG << " RT_ALREADY_SAME reserved direction " << dst_port << " for flit " << received_flit << endl; } else if (rt_status == RT_OUTVC_BUSY) { LOG << " RT_OUTVC_BUSY reservation direction " << dst_port << " for flit " << received_flit << endl; } else assert(false); // 此处没有有意义的状态 } } } // 转发 for (unsigned int i = 0; i < rxChannels.size(); i++) { int channel = rxChannels[i]; vector<pair<int, int> > reservations = antenna2tile_reservation_table.getReservations(channel); if (reservations.size() != 0) { int rnd_idx = rand() % reservations.size(); int port = reservations[rnd_idx].first; int vc = reservations[rnd_idx].second; if (!(target[channel]->buffer_rx.IsEmpty())) { Flit received_flit = target[channel]->buffer_rx.Front(); power.antennaBufferFront(); if (!buffer_to_tile[port][vc].IsFull()) { target[channel]->buffer_rx.Pop(); // 从天线 buffer_rx 移除 Flit power.antennaBufferPop(); // 更新天线缓冲区弹出操作的功耗统计 LOG << "*** [Ch" << channel << "] Moving flit " << received_flit << " from buffer_rx to buffer_to_tile[" << port << "][" << vc << "]" << endl; buffer_to_tile[port][vc].Push(received_flit);	// 将 Flit 推送到 buffer_to_tile power.bufferToTilePush(); // 更新 bufferToTile 推送操作的功耗统计 if (received_flit.flit_type == FLIT_TYPE_TAIL) { LOG << "Releasing reservation for output port " << port << ", flit " << received_flit << endl; TReservation r; r.input = channel; r.vc = vc; antenna2tile_reservation_table.release(r, port); } } else LOG << "Full buffer_to_tile[" << port << "][" << vc << "], cannot store " << received_flit << endl; } else { // 应该没问题 /* LOG << "WARNING: empty target["<<channel<<"] buffer_rx, but reservation still present, if correct, remove assertion below " << endl; assert(false); */ } } }
}

