void Hub::tileToAntennaProcess()
{ // double cycle = sc_time_stamp().to_double() / GlobalParams::clock_period_ps; // if (cycle > 0 && cycle < 58428) // { // if (local_id == 1) // { // cout << "CYCLES " << cycle << endl; // for (int j = 0; j < num_ports; j++) // buffer_from_tile[j].Print();; // init[0]->buffer_tx.Print(); // cout << endl; // } // } // 1. 复位处理：如果复位信号有效，则初始化发送通道 if (reset.read()) { for (unsigned int i = 0; i < txChannels.size(); i++) { int channel = txChannels[i]; flag[channel]->write(HOLD_CHANNEL); // 设置通道为 HOLD 状态 } TBufferFullStatus bfs; for (int i = 0; i < num_ports; i++) { ack_rx[i]->write(0); // 关闭确认信号 buffer_full_status_rx[i].write(bfs); // 初始化缓冲区满状态 current_level_rx[i] = 0; // 重置当前接收电平 } return; } // 2. 令牌环 MAC 策略处理：根据配置的 MAC 策略处理每个发送通道 for (unsigned int i = 0; i < txChannels.size(); i++) { int channel = txChannels[i]; string macPolicy = token_ring->getPolicy(channel).first; if (macPolicy == TOKEN_PACKET) txRadioProcessTokenPacket(channel); // TOKEN_PACKET 策略 else if (macPolicy == TOKEN_HOLD) txRadioProcessTokenHold(channel); // TOKEN_HOLD 策略 else if (macPolicy == TOKEN_MAX_HOLD) txRadioProcessTokenMaxHold(channel); // TOKEN_MAX_HOLD 策略 else assert(false); // 未知的 MAC 策略 } int last_reserved = NOT_VALID; // 用于存储路由决策 int *r_from_tile[num_ports]; for (int i = 0; i < num_ports; i++) r_from_tile[i] = new int[GlobalParams::n_virtual_channels]; // 3. 预留阶段：为从 Tile 到天线的传输进行通道预留 for (int j = 0; j < num_ports; j++) { int i = (start_from_port + j) % (num_ports); // 循环遍历端口 for (int k = 0; k < GlobalParams::n_virtual_channels; k++) { int vc = (start_from_vc[i] + k) % (GlobalParams::n_virtual_channels); // 4. 检查 buffer_from_tile 是否为空 if (!buffer_from_tile[i][vc].IsEmpty()) { LOG << "Reservation: buffer_from_tile[" << i << "][" << vc << "] not empty " << endl; Flit flit = buffer_from_tile[i][vc].Front(); assert(flit.vc_id == vc); power.bufferFromTileFront(); // 更新 bufferFromTile 前端操作的功耗统计 r_from_tile[i][vc] = route(flit); // 进行路由决策 // 5. 如果是 HEAD Flit，则进行通道预留 if (flit.flit_type == FLIT_TYPE_HEAD) { TReservation r; r.input = i; r.vc = vc; assert(r_from_tile[i][vc] == DIRECTION_WIRELESS); int channel; // 确定目标通道 if (flit.hub_relay_node == NOT_VALID) channel = selectChannel(local_id, tile2Hub(flit.dst_id)); else channel = selectChannel(local_id, tile2Hub(flit.hub_relay_node)); assert(channel != NOT_VALID && "hubs are not connected by any channel"); LOG << "Checking reservation availability of Channel " << channel << " by Hub port[" << i << "][" << vc << "] for flit " << flit << endl; int rt_status = tile2antenna_reservation_table.checkReservation(r, channel); if (rt_status == RT_AVAILABLE) { LOG << "Reservation of channel " << channel << " from Hub port[" << i << "][" << vc << "] by flit " << flit << endl; tile2antenna_reservation_table.reserve(r, channel); // 预留通道 } else if (rt_status == RT_ALREADY_SAME) { LOG << "RT_ALREADY_SAME reserved channel " << channel << " for flit " << flit << endl; } else if (rt_status == RT_OUTVC_BUSY) { LOG << "RT_OUTVC_BUSY reservation for channel " << channel << " for flit " << flit << endl; } else if (rt_status == RT_ALREADY_OTHER_OUT) { LOG << "RT_ALREADY_OTHER_OUT a channel different from " << channel << " already reserved by Hub port[" << i << "][" << vc << "]" << endl; } else assert(false); // 此处没有有意义的状态 } } } start_from_vc[i] = (start_from_vc[i] + 1) % GlobalParams::n_virtual_channels; } // for num_ports if (last_reserved != NOT_VALID) start_from_port = (last_reserved + 1) % num_ports; // 6. 转发阶段：将 Flit 从 buffer_from_tile 转发到天线 buffer_tx for (int i = 0; i < num_ports; i++) { vector<pair<int, int> > reservations = tile2antenna_reservation_table.getReservations(i); if (reservations.size() != 0) { int rnd_idx = rand() % reservations.size(); int o = reservations[rnd_idx].first; int vc = reservations[rnd_idx].second; // 7. 检查 buffer_from_tile 是否为空 if (!buffer_from_tile[i][vc].IsEmpty()) { Flit flit = buffer_from_tile[i][vc].Front(); // powerFront already accounted in 1st phase assert(r_from_tile[i][vc] == DIRECTION_WIRELESS);