int Hub::selectChannel(int src_hub, int dst_hub) const
{ // 1. 获取源 Hub 的发送通道和目标 Hub 的接收通道 vector<int> & first = GlobalParams::hub_configuration[src_hub].txChannels; vector<int> & second = GlobalParams::hub_configuration[dst_hub].rxChannels; // 2. 找到两个 Hub 之间共有的通道（交集） vector<int> intersection; for (unsigned int i = 0; i < first.size(); i++) { for (unsigned int j = 0; j < second.size(); j++) { if (first[i] == second[j]) intersection.push_back(first[i]); // 将共有通道添加到交集向量 } } // 3. 如果没有找到共有通道，则返回 NOT_VALID if (intersection.size() == 0) return NOT_VALID; // 4. 根据全局参数选择通道 if (GlobalParams::channel_selection == CHSEL_RANDOM) // 5. 如果选择随机通道，则从交集中随机选择一个通道 return intersection[rand() % intersection.size()]; else if (GlobalParams::channel_selection == CHSEL_FIRST_FREE) { // 6. 如果选择第一个空闲通道，则从交集中查找第一个空闲通道 int start_channel = rand() % intersection.size(); // 随机选择起始通道 int k; for (vector<int>::size_type i = 0; i < intersection.size(); i++) { k = (start_channel + i) % intersection.size(); // 循环遍历交集 // 7. 检查通道是否空闲 if (!transmission_in_progress.at(intersection[k])) { cout << "Found free channel " << intersection[k] << " on (src,dest) (" << src_hub << "," << dst_hub << ") " << endl; return intersection[k]; // 找到空闲通道，返回 } } // 8. 如果所有通道都忙，则应用随机选择 cout << "All channel busy, applying random selection " << endl; return intersection[rand() % intersection.size()]; } return NOT_VALID; // 未知的通道选择策略
}

