int ReservationTable::checkReservation(const TReservation r, const int port_out)
{ // 1. 检查是否存在禁止的表状态：相同的输入/VC 存在于不同的输出行中 for (int o = 0; o < n_outputs; o++) { for (vector<TReservation>::size_type i = 0; i < rtable[o].reservations.size(); i++) { // 在当前实现中，这不应该发生 if (o != port_out && rtable[o].reservations[i] == r) { return RT_ALREADY_OTHER_OUT; // 相同的输入/VC 已经预留了另一个输出端口 } } } // 2. 在给定的输出条目上，预留必须按 VC 区分 // 动机：它们将按周期交错，因为索引会移动 int n_reservations = rtable[port_out].reservations.size(); for (int i = 0; i < n_reservations; i++) { // 3. 预留已经存在 if (rtable[port_out].reservations[i] == r) return RT_ALREADY_SAME; // 相同的输入/VC 已经预留了该输出端口 // 4. 同一个 VC 已经被另一个输入预留了该输出端口 if (rtable[port_out].reservations[i].input != r.input && rtable[port_out].reservations[i].vc == r.vc) return RT_OUTVC_BUSY; // 该输出端口的同一个 VC 已经被另一个输入端口预留 } // 5. 没有冲突，该输出端口可用 return RT_AVAILABLE; // 该输出端口可用
}

