void ReservationTable::release(const TReservation r, const int port_out)
{ // 1. 断言检查：确保要释放的端口号在有效范围内 assert(port_out < n_outputs); // 2. 遍历指定输出端口的预留列表 for (vector<TReservation>::iterator i = rtable[port_out].reservations.begin(); i != rtable[port_out].reservations.end(); i++) { // 3. 查找要释放的预留项 if (*i == r) { // 4. 从预留列表中移除该预留项 rtable[port_out].reservations.erase(i); // 5. 计算被移除预留项的索引 vector<TReservation>::size_type removed_index = i - rtable[port_out].reservations.begin(); // 6. 更新优先级索引 if (removed_index < rtable[port_out].index) rtable[port_out].index--; // 如果移除的预留项在当前优先级索引之前，则减小优先级索引 else if (rtable[port_out].index >= rtable[port_out].reservations.size()) rtable[port_out].index = 0; // 如果优先级索引超出了预留列表的范围，则重置为 0 return; // 释放成功，退出函数 } } // 7. 如果没有找到要释放的预留项，则断言失败 assert(false); // trying to release a never made reservation ?
}

