void ProcessingElement::txProcess() { if (reset.read()) { req_tx.write(0); // 将请求信号置为0 current_level_tx = 0; // 重置当前传输级别 transmittedAtPreviousCycle = false; // 标记上一个周期没有传输 } else { Packet packet; // 创建一个新的数据包对象 // 检查是否可以生成新的数据包 if (canShot(packet)) { packet_queue.push(packet); // 将数据包推入队列 transmittedAtPreviousCycle = true; } else { transmittedAtPreviousCycle = false; } // 检查确认信号是否与当前传输级别匹配 if (ack_tx.read() == current_level_tx) { if (!packet_queue.empty()) { } else { transmittedAtPreviousCycle = false; // 标记上一个周期没有传输 } // 检查确认信号是否与当前传输级别匹配 if (ack_tx.read() == current_level_tx) { // 如果数据包队列不为空 if (!packet_queue.empty()) { Flit flit = nextFlit(); // 生成一个新的flit flit_tx->write(flit); // 发送生成的flit current_level_tx = 1 - current_level_tx; // 切换当前传输级别（用于交替位协议） req_tx.write(current_level_tx); // 更新请求信号 } } }
