bool ProcessingElement::canShot(Packet & packet)
{ if (never_transmit) return false; #ifdef DEADLOCK_AVOIDANCE if (local_id % 2 == 0) return false; #endif bool shot; double threshold; double now = sc_time_stamp().to_double() / GlobalParams::clock_period_ps; if (GlobalParams::traffic_distribution != TRAFFIC_TABLE_BASED) { if (!transmittedAtPreviousCycle) threshold = GlobalParams::packet_injection_rate; else threshold = GlobalParams::probability_of_retransmission; shot = (((double) rand()) / RAND_MAX < threshold); if (shot) { switch (GlobalParams::traffic_distribution) { case TRAFFIC_RANDOM: packet = trafficRandom(); break; case TRAFFIC_TRANSPOSE1: packet = trafficTranspose1(); break; case TRAFFIC_TRANSPOSE2: packet = trafficTranspose2(); break; case TRAFFIC_BIT_REVERSAL: packet = trafficBitReversal(); break; case TRAFFIC_SHUFFLE: packet = trafficShuffle(); break; case TRAFFIC_BUTTERFLY: packet = trafficButterfly(); break; case TRAFFIC_LOCAL: packet = trafficLocal(); break; case TRAFFIC_ULOCAL: packet = trafficULocal(); break; default: cout << "Invalid traffic distribution: " << GlobalParams::traffic_distribution << endl; exit(-1); } } } else { if (never_transmit) return false; bool use_pir = (transmittedAtPreviousCycle == false); vector<pair<int, double>> dst_prob; double threshold = traffic_table->getCumulativePirPor(local_id, (int) now, use_pir, dst_prob); double prob = (double) rand() / RAND_MAX; shot = (prob < threshold); if (shot) { for (unsigned int i = 0; i < dst_prob.size(); i++) { if (prob < dst_prob[i].second) { int vc = randInt(0, GlobalParams::n_virtual_channels - 1); packet.make(local_id, dst_prob[i].first, vc, now, getRandomSize()); break; } } } } return shot;
}

