Packet ProcessingElement::trafficRandom()
{ Packet p; p.src_id = local_id; // 设置数据包的源ID double rnd = rand() / (double) RAND_MAX; // 生成随机数 double range_start = 0.0; int max_id; // 最大目标ID // 根据网络拓扑设置最大ID if (GlobalParams::topology == TOPOLOGY_MESH) max_id = (GlobalParams::mesh_dim_x * GlobalParams::mesh_dim_y) - 1; else // 其他Delta拓扑 max_id = GlobalParams::n_delta_tiles - 1; // 生成随机目标ID do { p.dst_id = randInt(0, max_id); // 随机选择目标ID // 检查热点目标 for (size_t i = 0; i < GlobalParams::hotspots.size(); i++) { if (rnd >= range_start && rnd < range_start + GlobalParams::hotspots[i].second) { if (local_id != GlobalParams::hotspots[i].first) { p.dst_id = GlobalParams::hotspots[i].first; } break; } range_start += GlobalParams::hotspots[i].second; } #ifdef DEADLOCK_AVOIDANCE // 死锁避免处理 if (p.dst_id % 2 != 0) { p.dst_id = (p.dst_id + 1) % 256; } #endif } while (p.dst_id == p.src_id); // 确保目标ID不等于源ID // 设置数据包属性 p.timestamp = sc_time_stamp().to_double() / GlobalParams::clock_period_ps; p.size = p.flit_left = getRandomSize(); // 设置数据包大小 p.vc_id = randInt(0, GlobalParams::n_virtual_channels - 1); return p; // 返回生成的数据包
}

